public boolean moveNext() {
  try {
    Tuple tuple = this.tupleStream.read();
    if (tuple.EOF) {
      return false;
    } else {
      current = tuple;
      return true;
    }
  } catch (IOException e) {
    e.printStackTrace();
    return false;
  }
}

